	    "kort_navn": "FAB1",
	    "beskrivelse": "Du er en av de fem artistene i Sirkus Fabula. \r\n<br><br>Dere er et lite sirkus fra et lite sted i landsdelen Taddal, en liten utkant i Folkemenasjeriet, en stat styrt av store politiske sirkus.<br><br> \r\nDet lille sirkuset ditt seiler til hovedstaden Babel Magna for å prøve seg i konkurranse med flere erfarne sirkus-trupper om retten til å styre i landsdelen deres. Det  dere møter er et mørkt bymiljø, kyniske konkurrenter og et lettpåvirkelig publikum.<br><br>\r\nSe for deg fem bygdinger som tror de kan gjøre en forskjell, i et styresett som er basert på \"valgsirkus\" der sirkusartister blir \"valgt\" på bakgrunn av sine bedrifter i manesjen. Det er \"folkets billetter\" som bestemmer hvilket sirkus som skal styre i dette riket, og nå gjelder det styret av den lille fjellprovinsen Taddal. Dere er de enste som ER fra Taddal som stiller opp til dette valgsirkuset. De andre er profesjonelle artister som stiller opp for prestisjen.\r\n<br><br>Dette er fantasy slik du aldri har opplevd det før! Mer magisk og morsomt enn noengang! Velkommen!",
