	    "kort_navn": "SW:X-W",
	    "beskrivelse": "Star Wars X-Wing Miniatures har raskt utvidet seg til den nye tilskuersporten da alle har et forhold til de flotte miniatyrene som plasseres på det relativt beskjedne spillearealet på 90*90 cm.\r\n<br><br>\r\nDenne turnering vil følge siste offisielle sett med regler, FAQ og Official Tournament Rules (OTR) fra Fantasy Flight Games som bør finnes på denne siden: https://www.fantasyflightgames.com/en/products/x-wing/\r\n<br><br>\r\nMed mindre OTR endres drastisk vil formatet være 100 poeng av en fraksjon, det være seg Empire, Rebel eller \"Scum and Villainy\". Vær oppmerksom på hvordan initiativ avgjøres i OTR.\r\n<br><br>\r\nTa med egne brikker, kort, terninger, markers, asteroider og alt annet dere tror dere vil få bruk for.\r\n<br><br>\r\nArrangør påberoper seg ingen ekstraordinær forståelse av reglene, men vil dømme etter å ha hørt begge sider hvis det er noe som er uklart og han blir spurt om det av minst en av deltagerne. Alle får lov å spørre 3 ganger hver i løpet av turneringen.  Spørsmål kan også postes i.den åpne facebook-gruppa \"Flåtekommandoen\".\r\n<br><br>\r\nSkal vi levere inn liste på forhånd?<br><br>\r\nNei, men det skal leveres inn liste ved registrering. Og den skal være maskinskrevet.\r\n<br><br>\r\nHvordan kan jeg vite om listen er lovlig?<br><br>\r\nXwing-builder er til god hjelp. http://xwing-builder.co.uk/build Utskrifter fra den er et flott format.<br><br>\r\nEksempel: http://xwing-builder.co.uk/view/197932/ ... &amp;view=full",
