	    "navn": "Galaxy Trucker NM",
	    "kort_navn": "GTNM",
	    "beskrivelse": "Vi er veldig glade for å kunne annonsere Norges første offisielle Galaxy Trucker Norges Mesterskap! <br><br>\r\nBygg ditt romskip av skrapdeler og fly på oppdrag gjennom rommet. Møt på farer som meteorer og pirater, samle på ressurser fra forlatte romstasjoner og planeter. Alt dette mens du forsøker så godt du kan å holde romskipet ditt i ett stykke. <br><br>\r\nPulje1 vil være en demo/frispilling med innføring for de som ikke har spilt det før, med mulighet for å melde seg til kvalifiseringen i etterkant hvis det er ønskelig.<br><br>\r\nKvalifiseringen vil være i pulje 6 &amp; 7 og vil muligens foregå i 2 omganger avhengig av hvor mange påmeldte det er. Det vil bli spilt runde 1, 2 &amp; 3 av basis utgaven av Galaxy Trucker. De 5 med mest poeng (basert på % fra hvert bord) vil kvalifiseres til Finalen på Søndagen.<br><br>\r\nFinalen vil holdes i pulje 11 &amp; 12. Det vil bli spilt runde 2, 3 &amp; 4, og inkluderer Rough Roads og Evil Machinations samt alle typer Aliens og moduler. Visse kort vil bli fjernet fra oppdrags-bunken for å hindre at spillet stopper opp for mye, slik som Robosmokeys og Space Depot. \r\nDet blir kåret 1, 2 &amp; 3 plass basert på mengde poeng oppnådd i Finalen. <br><br>\r\nPremier er sponset av Czech Games Edition, utgiverene av Galaxy Trucker. <br><br>\r\nTruck on and Prosper!",
