	    "Rydding": null,
	    "new": "N",
	    "brosjyretekst": "7th ed. CoC. Spillerne befinner seg i Vietnam midt under Vietnam-krigen i 1969.\r\nUnder en tokt viser det seg at VC er nok ikke den verste de kommer til å støte på. Settes opp flere ganger i løpet av helgen.",
