	    "navn": "Mega Civilization",
	    "kort_navn": "MEGA",
	    "beskrivelse": "NB! Demoen krever MINST 9 spillere for gjennomføring!\r\nEndelig er det her, MEGA CIVILIZATION!\r\nNå er altså Mega Civilization kommet i en offisiell utgave som ser penere ut og er større enn noensinne!\r\nDet er mulighet for inntil 18 spillere å boltre seg i en enorm utgave av det klassiske spillet Advanced Civilization. Reglene er hovedtrekk det samme, med noen få endringer mtp ulykker og teknologier og hvordan de virker.<br><br>\r\nSpillet har enkle regler, og går ut på å utvikle en sivilisasjon fra den tidlige steinalder og frem til jernalderen. Spillet er intet krigsspill, selv om plassmangel som regel blir et problem for alle..\r\nDette er kun ment som en demo av spillet, da en fullverdig gjennomspilling ville tatt hele festivalen, og det hovedsaklig er ønskelig å vise frem en del av de nye elementene i spillet i form av nye teknologier, handelskort og ulykker.<br><br>\r\nDet vil derfor bli brukt en hurtig start slik at det skal være mulig å avslutte spillet iløpet av 6-8 timer.\r\nHver handelsrunde vil vare i 10 minutter og det vil bli brukt stoppeklokke, når den ringer har man 30 sekunder på avslutte en påbegynt handel, etter dette vil det være forbudt å bytte kort.<br><br>\r\nVi tar en pause på ca 20-30 minutter halvveis igjennom slik at man kan få ordnet seg en matbit, eller anskaffet noe drikke. Det finnes også regler for hvordan man rydder opp skulle en spiller skulle forlate spillet tidlig dersom en erstatter ikke finnes.\r\nFor spørsmål send en e-post til arrangør.",
