	    "kort_navn": "KTK",
	    "beskrivelse": "2 spillere, 30-50 min spilletid, 12 år +\r\nKill the King er et rykende ferskt brettspill hvor\r\nto spillere kjøper og kontrollerer hver sin hær og sloss mot hverandre. En spiller forsvarer en borg mens den andre spilleren angriper. Klarer forsvarerne å holde ut til kavaleriet kommer de til unnsetning eller bryter angriperne gjennom og dreper kongen? \r\n<br><br>\r\nDet er også mulig å spille en enkere og raskere versjon av spillet der kampene bare foregår ute på slagmarken\r\nVi har med oss fire prototyper til Arcon som er klare for testing av deltagerne. Spillet skal kickstartes i september og vi trenger mange gjennomspillinger for å få tilbakemeldinger som mulig\r\nFor mer informasjon gå inn på killtheking.no",
