	    "beskrivelse": "<!DOCTYPE html>\r\n<html>\r\n<body>\r\n<b><p style=\"color:#FF0000\">Arcon Social Club</p></b>\r\n<p>Årets Arcon kan by på en helt ny event for spillglade personer, \"Arcon Social Club\" arrangeres hele søndagen. Det blir sosiale, morsomme og lette spill hos oss. Vi garanterer mye moro og latter. Det blir også premiering til de ca 20 mest ivrigste spillerne. Dagen deles inn i bolker der det blir arrangert varierte spill som tar alt fra 5.min pr runde til en times tid. Vi har delt dagen inn i 4 bolker og følger da Arcons puljeprogram. </p>\r\n<b><p style=\"color:#FF0000\">Program</p></b>\r\n<p><b>13.00-15.30; ASC Formiddag</b></p>\r\nI denne økten vil vi arrangere spillene;\r\n<p><b>Spyfall</b></p>\r\nEt raskt og morsomt spill der man skal prøve å lokke ut spionen av gruppen. alle spillerne får vite en lokasjon man er på (eks; Musikkkonsert), en av deltagerne er spion og får ikke vite hvor man er. Nå begynner en spørrelek der spionen skal gjette seg frem til \"Musikkkonsert\" og de andre skal lure frem spionen. Ta med; Mobiltelefon med mulighet for netttilgang. Antall spillere; 3-40, tid; ca 10.min pr spill (vi spiller mange runder). Video regler; <a href=\"https://m.youtube.com/watch?v=YeXim1XFz5I\"> Spyfall tutorial</a>\r\n<p><b>The Resitance</b></p>\r\nThe Resistance er et engasjerende sosialt spill i samme gate som Werewolf og Mafia, men her blir ingen slått ut. Spillerne skal løse oppdrag og prøve å hindre spionen i å ødelegge. \r\nAntall spillere; 6-30, tid; ca 25.min pr spill (vi spiller 2-3 runder). Video regler; <a href=\"https://m.youtube.com/watch?v=GdofYPi9jLo\">Resistance tutorial</a>\r\n<p><b>One Night Werewolf</b></p>\r\nDenne klassikeren er et kjapt spill som passer best med 5-12 personer. Alle spillerne får utdelt roller og i nattfasen kan man plukke opp litt informasjon med sin karakter. I dag fasen skal man stemme på en man tror er varulv. Her må man snakke vekk mistanke mot seg selv og prøve å ikke bli tatt for varulv.  Antall spillere; 5-30, tid; ca 15.min pr runde (vi spiller flere runder). Video regler; <a href=\"https://m.youtube.com/watch?v=TDvq6iA8z7c\">One Night Werewolf tutorial</a>\r\n<p><b>Alle spill på samme rom hele dagen</b></p>\r\n<p>Alle spillene som inngår i Arcon Social Club finner sted på samme rom gjennom hele søndagen. Vi har med andre ord spilling i forskjellige økter fra 10.00-21.00</p>\r\n<p><b>Spillbar</b></p>\r\nFra 10-23 vil vi ha en spillbar i rommet, spillene vil være alle spill vi har spilt gjennom søndagen og lignende spill. Disse spillene kan lånes men det er ønskelig at man starter opp spill i vårt rom og at man er sosial og tar med seg andre spillere med på økten.  \r\n<b>Premiering</b></p>\r\nI alle spillene gjennom dagen vil man få tokens for deltagelse i et spill og enda en token for vunnet spill. Gjennom dagen kan man da samle seg tokens. Det er et premiebord i rommet og ca kl.21.30 er det premieutdeling der man kan veksle inn sine tokens i en premie. Det blir både brettspill, tv-serier, filmer, bøker og andre godbiter. Man kan også veksle ut tokens i løpet av dagen inn i en liten premie om man ikke kan være der til 21.30.\r\n</body>\r\n</html>",
