	    "beskrivelse": "Spillerne er plantasjeeiere som gjennom plantasjedrift og foredling av råvarer skal skaffe seg velstand og godt omdømme. Dyrk blant annet mais, kaffe og tobakk, bygg produktive foredlingsfabrikker og skaff deg gjerne et steinbrudd eller to. Reis flotte bygninger og send foredlede varer til Europa eller selg dem til handelshuset.<br><br>\r\nDet er en fordel å ha spilt spillet før, men ikke nødvendig. Spillet går ut på å balansere ressurser og handlinger med hensyn til hva alle de andre spillerene gjør, siden det meste som skjer kan påvirke alle.\r\nArrangør har 1 brett. Hvis noen spillere tar med egne brett, blir det plass til fler.",
