	    "beskrivelse": "En stor hær av skrømt og utysker truer den mektige bystaten Gridhamm. Allerede er  Frogard og Ljosebygd lagt øde, og Hyljatun er under beleiring. Faller Gridhamm, faller hele Gildaker!<br>\r\n<br>\r\nKongen av Gridhamm søker til de nærliggende bystatene for å finne støtte til forsvaret av byen, og sender ut diplomatiske utsendinger til alle som enda ikke er berørt av krigen. En en av disse utsendingene går til den eksentriske kong Vanrik av Ærre, som har trukket seg tilbake til sitt ferieslott på toppen av det skarpe fjellet bak byen. Her skal det vise seg at ikke alt er som forventet.\r\n<br><br>\r\nErfaring med rollespill, og helst en av versjonene av D&amp;D kreves, men erfaring med femte utgaven er ikke nødvendig for påmelding. Det forutsettes at mer erfarne spillere er behjelpelige med å støtte uerfarne spillere med reglene.",
