	    "kort_navn": "BID",
	    "beskrivelse": "Stjernehimmelen ligger dypt nede i det blekkmørke vannet, men ellers er det lite som skiller Duskwall fra enhver annen preindustralisert Fantasystorby. Vel, foruten havna hvor hvalfangerskipene som jakter de enorme demonhvalene, og som forøvrig legger grunnlaget for opprettholdelsen av adelskapets rikdom, innimellom legger inn. Eller det faktumet i kataklysmen for drøye ni århundrer siden så sprang dødsrikets porter og nå finner ingen hvile. Uansett, så er det på takene og i gondolsmugene at vår aspirerende kattetyvebande fra bydelen Kråkefoten står får sin egen spenning. Nå brygger det til krig.<br><br>\r\n(Vi bruker quickstart 6.0 War in Crow's foot.)<br>\r\nVil du spille rollespill, og tåler at spillerrollene har mindre skrupler enn deg selv? Vel, da bør du vurdere å være en av de som gjennomfører brekket som risikerer å ha samme effekt som visse skudd i en viss jugoslavisk OL-by...",
